import React from 'react'
import Sidebar from '../../Components/Sidebar/sidebar'


const Dashboard = () => {
  return (
    <div className='flex w-full text-black p-5 relative'> 
     
     <div></div> <Sidebar/>
      <div className='w-full bg-slate-900 text-white rounded-lg flex p-3 justify-between items-center'></div>
      
    

    </div>
    
  )
}

export default Dashboard
